import React from 'react';
import './App.css';

function App() {


    return React.createElement(
        "div", {
            className: "App"
        },
        React.createElement("header", {
                className: "App-header"
            },
            React.createElement("h1",
                null,
                "Hello from JSX!"
            )
        )
    );
}

export default App;
